import React from "react";

const Gallery = ({ images }) => {
	return (
		<section id="gallery">
			<div className="row">
				<div className="twelve columns collapsed">
					<h1>My Pictures</h1>
					<div id="gallery-wrapper">
						{images.map((image, index) => (
							<img
								key={index}
								src={`/myimages/${image}`}
								alt={`My Image ${index + 1}`}
							/>
						))}
					</div>
				</div>
			</div>
		</section>
	);
};
